import { createStore } from "vue";
import VueX from "vuex";

Vue.use(VueX);

export default new VueX.Store({
  state: {
    todos: [
      {
        title: "todo item completed A",
        completed: false,
      },
      {
        title: "todo item completed B",
        completed: false,
      },
    ],
  },
  getters: {},
  mutations: {},
  actions: {},
});
